(self.webpackChunkbugu=self.webpackChunkbugu||[]).push([[2902],{3508:(e,a,t)=>{"use strict";t.r(a),t.d(a,{data:()=>s});const s={key:"v-b9c672f0",path:"/Git/git_tag%E7%9A%84%E4%BD%BF%E7%94%A8.html",title:"git tag 给当前分支打标签",lang:"zh-CN",frontmatter:{},excerpt:"",headers:[{level:2,title:"git tag <tag name> 可以打一个新标签",slug:"git-tag-tag-name-可以打一个新标签",children:[]},{level:2,title:"可以用命令git tag查看所有标签.",slug:"可以用命令git-tag查看所有标签",children:[]},{level:2,title:"在历史提交上打 tag",slug:"在历史提交上打-tag",children:[]},{level:2,title:"带有说明的标签",slug:"带有说明的标签",children:[]},{level:2,title:"切换到某个tag",slug:"切换到某个tag",children:[]},{level:2,title:"推送某个标签到远程，使用命令git push origin <tagname>",slug:"推送某个标签到远程-使用命令git-push-origin-tagname",children:[]},{level:2,title:"一次性推送全部尚未推送到远程的本地标签",slug:"一次性推送全部尚未推送到远程的本地标签",children:[]},{level:2,title:"删除标签 git tag -d tagname",slug:"删除标签-git-tag-d-tagname",children:[]},{level:2,title:"删除远端标签 git push origin :refs/tags/<tagName>",slug:"删除远端标签-git-push-origin-refs-tags-tagname",children:[]}],filePathRelative:"Git/git_tag的使用.md",git:{updatedTime:1600154199e3}}},5140:(e,a,t)=>{"use strict";t.r(a),t.d(a,{default:()=>g});const s=(0,t(6252).uE)('<h1 id="git-tag-给当前分支打标签"><a class="header-anchor" href="#git-tag-给当前分支打标签">#</a> <code>git tag</code> 给当前分支打标签</h1><p><strong>假如我们给当前分支打<code>v1.0</code>标签</strong></p><h2 id="git-tag-tag-name-可以打一个新标签"><a class="header-anchor" href="#git-tag-tag-name-可以打一个新标签">#</a> <code>git tag &lt;tag name&gt; </code>可以打一个新标签</h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag v1.0 \n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>标签都只存储在本地，不会自动推送到远程。</p><h2 id="可以用命令git-tag查看所有标签"><a class="header-anchor" href="#可以用命令git-tag查看所有标签">#</a> 可以用命令<code>git tag</code>查看所有标签.</h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag \n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p>加上<code>-l</code>命令可以使用通配符来过滤<code>tag</code></p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag -l &quot;v1*&quot;\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="在历史提交上打-tag"><a class="header-anchor" href="#在历史提交上打-tag">#</a> 在历史提交上打 <code>tag</code></h2><p>查看commit id，使用commit id打tag</p><p>先<code>git log</code>查看历史提交记录<code>id</code>， 然后执行</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag v1.0 6df3aa614a45e687697a628a9174106822f79bfc\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><p><strong>注意</strong>，标签不是按时间顺序列出，而是按字母排序的。可以用<code>git show &lt;tagname&gt;</code>查看标签信息</p><h2 id="带有说明的标签"><a class="header-anchor" href="#带有说明的标签">#</a> 带有说明的标签</h2><p><strong>用-a指定标签名，-m指定说明文字：</strong></p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag -a v1.0 -m &quot;version 1.0&quot; 88d434eb9992fa7502ec246ecfb89aef19f16873\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="切换到某个tag"><a class="header-anchor" href="#切换到某个tag">#</a> 切换到某个tag</h2><p>和切换分支一样，不过这个时间不位于任何分支，处理游离状态。</p><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git checkout v1.0\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="推送某个标签到远程-使用命令git-push-origin-tagname"><a class="header-anchor" href="#推送某个标签到远程-使用命令git-push-origin-tagname">#</a> 推送某个标签到远程，使用命令<code>git push origin &lt;tagname&gt;</code></h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git push origin v1.0\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="一次性推送全部尚未推送到远程的本地标签"><a class="header-anchor" href="#一次性推送全部尚未推送到远程的本地标签">#</a> 一次性推送全部尚未推送到远程的本地标签</h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git push origin --tags\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="删除标签-git-tag-d-tagname"><a class="header-anchor" href="#删除标签-git-tag-d-tagname">#</a> 删除标签 <code>git tag -d tagname</code></h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git tag -d v1.0\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><h2 id="删除远端标签-git-push-origin-refs-tags-tagname"><a class="header-anchor" href="#删除远端标签-git-push-origin-refs-tags-tagname">#</a> 删除远端标签 <code>git push origin :refs/tags/&lt;tagName&gt;</code></h2><div class="language-text ext-text line-numbers-mode"><pre class="language-text"><code>$ git push origin :refs/tags/v1.0\n</code></pre><div class="line-numbers"><span class="line-number">1</span><br></div></div><blockquote><p>修改某个tag版应该怎么修改？？？</p></blockquote>',29),g={render:function(e,a){return s}}}}]);